import React from 'react';
import './Chat.css';


const row1Data = [
  { text: 'جيد', percentage: '70%', color: 'w3-green' },
  { text: 'سيئة', percentage: '20%', color: 'w3-red' },
  { text: 'باقة', percentage: '35%', color: 'w3-orange' },
  { text: 'كرت', percentage: '85%', color: 'w3-blue' },
];

const row2Data = [
  { text: 'ماشي', percentage: '15%', color: 'w3-yellow' },
  { text: 'ايوة', percentage: '10%', color: 'w3-light-green' },
  { text: 'لا', percentage: '50%', color: 'w3-purple' },
  { text: 'مشكلة', percentage: '20%', color: 'w3-light-blue' },
];

function Chat() {
  return (
    <div>
      <link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css" />
      <div className='conv-container'>
      </div>
      <div className='conv-analysis'>
        <table>
          <tbody>
            <tr>
              {row1Data.map((item, index) => (
                <td key={index}>
                  <span>{item.text}</span>
                  <div className={`w3-light-grey w3-round-xlarge ${item.color}`}>
                    <div className={`w3-container ${item.color} w3-round-xlarge`} style={{ width: item.percentage }}>{item.percentage}</div>
                  </div>
                </td>
              ))}
            </tr>
            <tr>
              {row2Data.map((item, index) => (
                <td key={index}>
                  <span>{item.text}</span>
                  <div className={`w3-light-grey w3-round-xlarge ${item.color}`}>
                    <div className={`w3-container ${item.color} w3-round-xlarge`} style={{ width: item.percentage }}>{item.percentage}</div>
                  </div>
                </td>
              ))}
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Chat;
